function questions(){
    var m = question.length
    for (let i = 0; i < m; i++) {
        var c = randomNoRepeats(que);
        question[i].textContent = c();
    }

}

function randomNoRepeats(array) {
    var copy = array.slice(0);
    return function() {
      if (copy.length < 1) { copy = array.slice(0); }
      var index = Math.floor(Math.random() * copy.length);
      var item = copy[index];
      copy.splice(index, 1);
      return item;
    };
  }

questions();

function checkans() {

    var n = slider.length
    console.log(n)
    for (let i = 0; i < n; i++) {
        ans.push(slider[i].value)
    }
    console.log("in function", ans)
    prediction(ans)
}


function prediction(ans) {
    var DecisionTree = decisionTree;
    var training_data = data()
    var test_data = data()
    var class_name = "Personality (class label)";
    var features = ["openness", "neuroticism", "conscientiousness", "agreeableness", "extraversion"];
    var dt = new DecisionTree(training_data, class_name, features);
    var predicted_class = dt.predict({
        "openness": ans[0],
        "neuroticism": ans[1],
        "conscientiousness": ans[2],
        "agreeableness": ans[3],
        "extraversion": ans[4],
    });
    var accuracy = dt.evaluate(test_data) * 100;
    accuracy = accuracy.toFixed(2);
    localStorage.setItem('accuracy',accuracy);
    localStorage.setItem('personality',predicted_class);
}

